import React from "react";
import "./Styles/Pages.css";

const Home = () => {
  return (
    <div id="Home">
      <head>
        <title>InfoCovid</title>
      </head>
      <div className="title">
        <h1>Selamat datang di infoCovid</h1>
      </div>
    </div>
  );
};

export default Home;
